import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Paper,
  Tabs,
  Tab,
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Alert,
  CircularProgress,
  Chip,
  Menu,
  MenuItem,
  Link
} from '@mui/material';
import {
  Edit as EditIcon,
  Delete as DeleteIcon,
  Check as CheckIcon,
  Close as CloseIcon,
  MoreVert as MoreVertIcon,
  OpenInNew as OpenInNewIcon
} from '@mui/icons-material';
import axios from '../utils/axios';

const TabPanel = ({ children, value, index, ...other }) => (
  <div
    role="tabpanel"
    hidden={value !== index}
    {...other}
  >
    {value === index && (
      <Box sx={{ p: 3 }}>
        {children}
      </Box>
    )}
  </div>
);

const AdminDashboard = () => {
  const [tabValue, setTabValue] = useState(0);
  const [users, setUsers] = useState([]);
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [successMessage, setSuccessMessage] = useState('');
  const [editDialogOpen, setEditDialogOpen] = useState(false);
  const [deleteDialogOpen, setDeleteDialogOpen] = useState(false);
  const [selectedItem, setSelectedItem] = useState(null);
  const [editFormData, setEditFormData] = useState({});
  const [anchorEl, setAnchorEl] = useState(null);
  const [pendingResources, setPendingResources] = useState([]);
  const [selectedResource, setSelectedResource] = useState(null);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [actionType, setActionType] = useState(null);

  useEffect(() => {
    fetchData();
    fetchPendingResources();
  }, [tabValue]);

  const fetchData = async () => {
    try {
      setLoading(true);
      setError(null);
      if (tabValue === 0) {
        const response = await axios.get('/api/admin/users');
        setUsers(response.data.users);
      } else {
        const response = await axios.get('/api/admin/resources');
        setResources(response.data.resources);
      }
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to load data. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  const fetchPendingResources = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/resources/pending');
      setPendingResources(response.data.resources);
    } catch (error) {
      console.error('Error fetching pending resources:', error);
      setError('Failed to load pending resources');
    } finally {
      setLoading(false);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const handleEditClick = (item) => {
    setSelectedItem(item);
    setEditFormData(item);
    setEditDialogOpen(true);
  };

  const handleDeleteClick = (item) => {
    setSelectedItem(item);
    setDeleteDialogOpen(true);
  };

  const handleMenuClick = (event, item) => {
    setAnchorEl(event.currentTarget);
    setSelectedItem(item);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    setSelectedItem(null);
  };

  const handleEditSubmit = async () => {
    try {
      setLoading(true);
      setError(null);
      setSuccessMessage('');

      if (tabValue === 0) {
        await axios.put(`/api/admin/users/${selectedItem.id}`, editFormData);
      } else {
        await axios.put(`/api/admin/resources/${selectedItem.id}`, editFormData);
      }

      setSuccessMessage('Item updated successfully');
      setEditDialogOpen(false);
      fetchData();
    } catch (error) {
      console.error('Error updating item:', error);
      setError(error.response?.data?.message || 'Failed to update item. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async () => {
    try {
      setLoading(true);
      setError(null);
      setSuccessMessage('');

      if (tabValue === 0) {
        await axios.delete(`/api/admin/users/${selectedItem.id}`);
      } else {
        await axios.delete(`/api/admin/resources/${selectedItem.id}`);
      }

      setSuccessMessage('Item deleted successfully');
      setDeleteDialogOpen(false);
      fetchData();
    } catch (error) {
      console.error('Error deleting item:', error);
      setError(error.response?.data?.message || 'Failed to delete item. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEditFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleApproveResource = async (resourceId) => {
    try {
      setLoading(true);
      setError(null);
      setSuccessMessage('');

      await axios.put(`/api/admin/resources/${resourceId}/approve`);
      setSuccessMessage('Resource approved successfully');
      fetchData();
    } catch (error) {
      console.error('Error approving resource:', error);
      setError(error.response?.data?.message || 'Failed to approve resource. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleRejectResource = async (resourceId) => {
    try {
      setLoading(true);
      setError(null);
      setSuccessMessage('');

      await axios.put(`/api/admin/resources/${resourceId}/reject`);
      setSuccessMessage('Resource rejected successfully');
      fetchData();
    } catch (error) {
      console.error('Error rejecting resource:', error);
      setError(error.response?.data?.message || 'Failed to reject resource. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleAction = (resource, type) => {
    setSelectedResource(resource);
    setActionType(type);
    setDialogOpen(true);
  };

  const handleConfirmAction = async () => {
    try {
      if (actionType === 'approve') {
        await axios.put(`/api/resources/${selectedResource.id}`, {
          ...selectedResource,
          is_approved: true
        });
      } else {
        await axios.delete(`/api/resources/${selectedResource.id}`);
      }

      // Refresh the list
      fetchPendingResources();
      setDialogOpen(false);
    } catch (error) {
      console.error('Error processing resource:', error);
      setError(`Failed to ${actionType} resource`);
    }
  };

  if (loading && !editDialogOpen && !deleteDialogOpen) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="60vh">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper elevation={3}>
        <Typography variant="h4" component="h1" gutterBottom sx={{ p: 3, pb: 0 }}>
          Admin Dashboard
        </Typography>

        <Tabs value={tabValue} onChange={handleTabChange} sx={{ px: 3 }}>
          <Tab label="Users" />
          <Tab label="Resources" />
        </Tabs>

        {error && (
          <Alert severity="error" sx={{ m: 3 }}>
            {error}
          </Alert>
        )}

        {successMessage && (
          <Alert severity="success" sx={{ m: 3 }}>
            {successMessage}
          </Alert>
        )}

        <TabPanel value={tabValue} index={0}>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Username</TableCell>
                  <TableCell>Email</TableCell>
                  <TableCell>Role</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {users.map((user) => (
                  <TableRow key={user.id}>
                    <TableCell>{user.username}</TableCell>
                    <TableCell>{user.email}</TableCell>
                    <TableCell>
                      <Chip
                        label={user.role}
                        color={user.role === 'admin' ? 'primary' : 'default'}
                        size="small"
                      />
                    </TableCell>
                    <TableCell>
                      <IconButton onClick={() => handleEditClick(user)}>
                        <EditIcon />
                      </IconButton>
                      <IconButton onClick={() => handleDeleteClick(user)}>
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </TabPanel>

        <TabPanel value={tabValue} index={1}>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Title</TableCell>
                  <TableCell>Category</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Submitted By</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {resources.map((resource) => (
                  <TableRow key={resource.id}>
                    <TableCell>{resource.title}</TableCell>
                    <TableCell>{resource.category}</TableCell>
                    <TableCell>
                      <Chip
                        label={resource.status}
                        color={
                          resource.status === 'approved'
                            ? 'success'
                            : resource.status === 'rejected'
                            ? 'error'
                            : 'warning'
                        }
                        size="small"
                      />
                    </TableCell>
                    <TableCell>{resource.submitted_by}</TableCell>
                    <TableCell>
                      {resource.status === 'pending' && (
                        <>
                          <IconButton
                            onClick={() => handleApproveResource(resource.id)}
                            color="success"
                          >
                            <CheckIcon />
                          </IconButton>
                          <IconButton
                            onClick={() => handleRejectResource(resource.id)}
                            color="error"
                          >
                            <CloseIcon />
                          </IconButton>
                        </>
                      )}
                      <IconButton onClick={() => handleEditClick(resource)}>
                        <EditIcon />
                      </IconButton>
                      <IconButton onClick={() => handleDeleteClick(resource)}>
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </TabPanel>
      </Paper>

      <Paper sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          Pending Resources
        </Typography>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        {pendingResources.length === 0 ? (
          <Alert severity="info">No pending resources to review.</Alert>
        ) : (
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Title</TableCell>
                  <TableCell>Category</TableCell>
                  <TableCell>Submitter</TableCell>
                  <TableCell>URL</TableCell>
                  <TableCell align="right">Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {pendingResources.map((resource) => (
                  <TableRow key={resource.id}>
                    <TableCell>{resource.title}</TableCell>
                    <TableCell>{resource.category}</TableCell>
                    <TableCell>{resource.submitter || 'Anonymous'}</TableCell>
                    <TableCell>
                      <Link
                        href={resource.url}
                        target="_blank"
                        rel="noopener noreferrer"
                        sx={{ display: 'flex', alignItems: 'center' }}
                      >
                        Visit <OpenInNewIcon sx={{ ml: 0.5, fontSize: 16 }} />
                      </Link>
                    </TableCell>
                    <TableCell align="right">
                      <IconButton
                        color="success"
                        onClick={() => handleAction(resource, 'approve')}
                        title="Approve"
                      >
                        <CheckIcon />
                      </IconButton>
                      <IconButton
                        color="error"
                        onClick={() => handleAction(resource, 'reject')}
                        title="Reject"
                      >
                        <CloseIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        )}
      </Paper>

      {/* Edit Dialog */}
      <Dialog open={editDialogOpen} onClose={() => setEditDialogOpen(false)} maxWidth="sm" fullWidth>
        <DialogTitle>
          Edit {tabValue === 0 ? 'User' : 'Resource'}
        </DialogTitle>
        <DialogContent>
          {selectedItem && (
            <Box sx={{ pt: 2 }}>
              {tabValue === 0 ? (
                <>
                  <TextField
                    fullWidth
                    label="Username"
                    name="username"
                    value={editFormData.username || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                  <TextField
                    fullWidth
                    label="Email"
                    name="email"
                    type="email"
                    value={editFormData.email || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                  <TextField
                    fullWidth
                    label="Role"
                    name="role"
                    value={editFormData.role || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                </>
              ) : (
                <>
                  <TextField
                    fullWidth
                    label="Title"
                    name="title"
                    value={editFormData.title || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                  <TextField
                    fullWidth
                    label="Category"
                    name="category"
                    value={editFormData.category || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                  <TextField
                    fullWidth
                    label="Description"
                    name="description"
                    multiline
                    rows={4}
                    value={editFormData.description || ''}
                    onChange={handleChange}
                    margin="normal"
                  />
                </>
              )}
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setEditDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleEditSubmit} variant="contained" disabled={loading}>
            {loading ? 'Updating...' : 'Update'}
          </Button>
        </DialogActions>
      </Dialog>

      {/* Delete Dialog */}
      <Dialog open={deleteDialogOpen} onClose={() => setDeleteDialogOpen(false)}>
        <DialogTitle>
          Delete {tabValue === 0 ? 'User' : 'Resource'}
        </DialogTitle>
        <DialogContent>
          <Typography>
            Are you sure you want to delete this {tabValue === 0 ? 'user' : 'resource'}? This action cannot be undone.
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDeleteDialogOpen(false)}>Cancel</Button>
          <Button onClick={handleDelete} color="error" variant="contained" disabled={loading}>
            {loading ? 'Deleting...' : 'Delete'}
          </Button>
        </DialogActions>
      </Dialog>

      <Dialog open={dialogOpen} onClose={() => setDialogOpen(false)}>
        <DialogTitle>
          {actionType === 'approve' ? 'Approve Resource' : 'Reject Resource'}
        </DialogTitle>
        <DialogContent>
          Are you sure you want to {actionType} "{selectedResource?.title}"?
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDialogOpen(false)}>Cancel</Button>
          <Button
            onClick={handleConfirmAction}
            color={actionType === 'approve' ? 'success' : 'error'}
            variant="contained"
          >
            Confirm {actionType === 'approve' ? 'Approval' : 'Rejection'}
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default AdminDashboard;
